import styled from 'styled-components';

export const HeaderContent = styled.header`
    width: 100%;
    display: flex;
    flex-grow: 1;
    justify-content: flex-start;
    align-items: center;
    background-color: #000000;
`;

export const HeaderLogo = styled.div`
    color: #FFFFFF;
    font-size: 20px;
    text-decoration: none;
    margin-left: 25px;
`;
